import React from 'react';

const HOST_API = 'http://localhost:8080/api/v1/';

class EmployeeService {

    getEmployees() {
        return fetch(HOST_API + '/employees')
            .then(response => response.json())
            .then(data => {
                return data;
            });
    }

}

export default EmployeeService;
